import React from 'react';
import './css/UI.css';
import List from './List.jsx';

class Content extends React.Component{
    render(){
      const activities=[
        {
          "title":"my Title",
          "desc":"Morning activity"
        },
        {
          "title":"Second Title",
          "desc":"Second activity"
        }
      ]

      return (
        <div>
        <List title={activities[0].title} desc={activities[0].desc}/>
        <List title={activities[1].title} desc={activities[1].desc}/>
        </div>
      )
    }
}
export default Content;
